import axios from "axios"

const config = "http://localhost:8080";


export const signin = user=>{
  console.log("user",user)
  return axios.post("http://localhost:8080/api/auth/signin",{
    email:user.email,
    password:user.password
  }).then(res =>{
    return res.data;
  }).catch(err =>{
    console.log("error",err)
  })
}
